let Plus = () => {
  let [name , newName] = useState();

  let inputField = (event) => {
    newName(event.target.value);
  }
  return (
    <>
      <div className = "container">
        <h1>Hello </h1>
        <input type = "text" value = {name} onClick = {inputField}/>
        <button onClick = "onSubmit">Click Me</button>
      </div>
    </>
  )
}
export default Plus;
